    true,nt"url": null,nt"notes": "MyPyramid Food Data provides information
    on the total calories; calories from solid fats, added sugars, and alcohol (extras);
    MyPyramid food group and subgroup amounts; and saturated fat content of over 1,000
    commonly eaten foods with corresponding commonly used portion amounts. This information
    is key to help consumers meet the recommendations of the Dietary Guidelines for
    Americans and manage their weight by understanding how many calories are consumed
    from "extras." CNPP has created an interactive tool from this data set available
    on the web at MyFood-a-pedia.gov. A mobile version is coming soon to provide consumers
